svg.script:
var data = {
    "sb3": ["creighton", "hughes", "kolkhorst", "paxton", "perry", "birdwell", "campbell", "schwertner"],
    "sb17": ["creighton", "kolkhorst", "paxton", "bettencourt", "hall", "middleton", "parker", "perry", "birdwell", "campbell", "king", "schwertner", "springer", "huffman"],
    "hb900": ["creighton", "hughes", "kolkhorst", "paxton", "hall", "middleton", "parker", "king", "springer", "sparks"],
    "hb18": ["creighton", "hughes", "kolkhorst", "paxton", "bettencourt", "hall", "parker", "blanco", "menendez"],
    "sb763": ["creighton", "hughes", "bettencourt", "middleton", "perry"]
};

function selectBill(x) {
  document.querySelectorAll(".author").forEach((i) => {
    i.setAttribute("class", "sen");
  });
  let count = 0;
  data[x].forEach((i) => {
    document.querySelector("#sen-" + i).setAttribute("class", "sen author");
    count++;
  });
  document.querySelector("#totalCount").setAttribute("class", "");
  document.querySelector("#totalCount text").textContent = "Total: " + count;
  document.querySelectorAll(".active").forEach((i) => {
    i.setAttribute("class", "svg-btn");
  });
  document.querySelector("#svg-btn-" + x).setAttribute("class", "svg-btn active");
}
